import PySimpleGUI as sg
import time
import base64
from PIL import Image
import io

width_display = (1920,1080)
BORDER_COLOR = '#194369'
DARK_HEADER_COLOR = '#112C45'

top_banner = [sg.Column([[
    sg.Text('MCC Vision System Checking', font=('Any 22'), background_color=DARK_HEADER_COLOR, size=(50,1),),
    sg.Text('' , font='Any 22', key='timetext', background_color=DARK_HEADER_COLOR, size=(61,1), justification='R')
]], size=(width_display[0], 50), pad = (0, 0), background_color=DARK_HEADER_COLOR
)]

itemWidth = (width_display[0] - 40) / 3
itemHeight = (width_display[1] - 80) / 2
sizeTitle = (int(itemWidth * 162 / width_display[0]) , 1)
fontTitle = ('Helvetica', 16)
fontText = ('Helvetica', 12)

sizeResult = (int(itemWidth * 122 / width_display[0]) , 1)
fontResult = ('Helvetica', 20)

imageSample = b''
image_SIZE = (int(itemWidth), int(itemHeight) - 100)
buffer = io.BytesIO()
imgdata = base64.b64decode(imageSample)
img = Image.open(io.BytesIO(imgdata))
new_img = img.resize(image_SIZE)  # x, y
new_img.save(buffer, format="PNG")
img_b64 = base64.b64encode(buffer.getvalue())

def createComponet(deviceID):    
    frontItem = sg.Column([[sg.T('Font Checking', font= fontTitle, background_color=BORDER_COLOR, size=sizeTitle, justification='c', pad = (0,0))], 
        [sg.T(deviceID + ':', font= fontText, background_color=DARK_HEADER_COLOR),
          sg.Input(sg.user_settings_get_entry('-dev1-', ''), key='-dev1-', size=(15, 1), font= fontText),
          sg.B('update', key='updDev1', font= fontText), 
          sg.T('Enable'  + ' ' * 6 + ':', font= fontText, background_color=DARK_HEADER_COLOR, pad = ((30,0),(0,0))),
          sg.CB('enable Device', font=fontText, enable_events=True, k='-enableDev-', background_color=DARK_HEADER_COLOR, default=sg.user_settings_get_entry('-enableDev-', ''))
        ], [sg.T('Result', font= fontResult, background_color=DARK_HEADER_COLOR, size=sizeResult, justification='c', pad = (0,0))],
        [sg.Image(data=img_b64, pad=(0, 0), key='image')]
      ],size=(itemWidth, itemHeight), background_color=DARK_HEADER_COLOR, pad = ((10, 0), (10, 10)))
    
    return frontItem





prev = [sg.T('Font Checking', font= fontTitle, background_color=BORDER_COLOR, size=sizeTitle, justification='c', pad = (0,0))]
frontItem = sg.Column([[sg.T('Font Checking', font= fontTitle, background_color=BORDER_COLOR, size=sizeTitle, justification='c', pad = (0,0))], 
        [sg.T('Device ID :', font= fontText, background_color=DARK_HEADER_COLOR),
          sg.Input(sg.user_settings_get_entry('-dev1-', ''), key='-dev1-', size=(15, 1), font= fontText),
          sg.B('update', key='updDev1', font= fontText), 
          sg.T('Enable'  + ' ' * 6 + ':', font= fontText, background_color=DARK_HEADER_COLOR, pad = ((30,0),(0,0))),
          sg.CB('enable Device', font=fontText, enable_events=True, k='-enableDev-', background_color=DARK_HEADER_COLOR, default=sg.user_settings_get_entry('-enableDev-', ''))
        ], [sg.T('Result', font= fontResult, background_color=DARK_HEADER_COLOR, size=sizeResult, justification='c', pad = (0,0))],
        [sg.Image(data=img_b64, pad=(0, 0), key='image')]
      ],size=(itemWidth, itemHeight), background_color=DARK_HEADER_COLOR, pad = (10, 10))

leftItem = sg.Column([[sg.Column([[]],  background_color='green', size=(200,100), pad = (0, 0))]],
        size=(itemWidth, itemHeight), background_color=DARK_HEADER_COLOR, pad = (0, 10))

rightItem = sg.Column([[sg.Text('Column2', background_color='green', size=(50,20))]],
        size=(itemWidth, itemHeight), background_color=DARK_HEADER_COLOR, pad = (10, 10))

#contTop = [frontItem, leftItem, rightItem]
deviceList = ('Device 1', 'Device 2', 'Device 3')
contTop = [createComponet(deviceName) for deviceName in deviceList]

backItem = sg.Column([[sg.Text('Column2', background_color='green', size=(50,20))]],
        size=(itemWidth, itemHeight), background_color=DARK_HEADER_COLOR, pad = ((10, 0), (0, 10)))

topItem = sg.Column([[sg.Text('Column2', background_color='green', size=(50,20))]],
        size=(itemWidth, itemHeight), background_color=DARK_HEADER_COLOR, pad = ((10, 0), (0, 10)))

configItem = sg.Column([[sg.Text('Column2', background_color='green', size=(50,20))]],
        size=(itemWidth, itemHeight), background_color=DARK_HEADER_COLOR, pad = ((10, 10), (0, 10)))


deviceList1 = ('Device 4', 'Device 5')
contButtom = [[createComponet(deviceName) for deviceName in deviceList1], configItem]


layout = [top_banner, contTop, contButtom]

window = sg.Window('MCC Visual Inspection',
                layout, finalize=True,
                resizable=True,
                no_titlebar=True,
                margins=(0, 0),
                grab_anywhere=True,
                location=(0, 0), right_click_menu=sg.MENU_RIGHT_CLICK_EDITME_VER_EXIT)

while True:    
    window['timetext'].update(time.strftime('%H:%M:%S'))
    event, values = window.read(timeout=20)
    if event in (sg.WINDOW_CLOSED, 'Exit'):
        break    
window.close()